import { Component } from "react"
import DashBoardNavigator from "./DashBoardNavigator/DashBoardNavigator";
import TodayRecovery from "./TodayRecovery/TodayRecovery";
import MonthlyRemainRecovery from "./ThisMonthWholeRecovery/MonthlyRecoveryReport";

class MainDashBoard extends Component{
    state = {
        menuSwitcher: ''
    }
    menuSwitchHandler = menu =>{
        this.setState({menuSwitcher: menu});
    }
    render(){
        return(
            <>
                <div className='col-md-3'>
                    <DashBoardNavigator menuSwitchingHandler={this.menuSwitchHandler}/>
                </div>
                <div className='col-md-9'> 
                    <TodayRecovery/>
                    <MonthlyRemainRecovery/>                    
                </div>
            </>
        );
    }
}

export default  MainDashBoard;
